inputStr = ""
lenMarker = 14
def main():
    for i in range(len(inputStr) - lenMarker + 1):
        for j in range(lenMarker):
            marker = list(inputStr[i:i + lenMarker])
            del marker[j]
            if inputStr[i + j] in marker:
                break
            elif j == lenMarker - 1:
                print(i + lenMarker)

main()